import React from "react";
import PropTypes from "prop-types";

const Navbar = props => {
  const { icon, title } = props;
  return (
    <nav className=" navbar bg-danger">
      <h1>
        <i className={icon} />
        {title}
      </h1>
    </nav>
  );
};

Navbar.defaultProps = {
  title: "Github Finder",
  icon: "fab fa-github"
};

Navbar.propTypes = {
  title: PropTypes.string.isRequired,
  icon: PropTypes.string.isRequired
};

export default Navbar;
